import React ,{ Component} from 'react'
import Papers from './components/papers'


const urlPapers ='https://tesisservice.azurewebsites.net/api/Papers/GetPapers';

class app extends React.Component {
  constructor(props) {
    super(props);
  /*   this.state = {papers :
      [  {id :1 , title :'name1' },
         {id :2 , title :'name2' },
         {id :3 , title :'name3' },
     ]}; */
  }

  componentDidMount() {
    fetch(urlPapers)
      .then((response) => response.json())
      .then((data) => {
        this.setState({papers : data.list}) 
      });
  }

  render(){
    return <Papers dataPapers={this.state.papers}></Papers>
  }
}



export default app;
